import React from 'react';

class Nav extends React.Component {
    constructor(props) {
        super(props);
    }

    renderSpan(tab, tabName, activ) {
        return (
            <span className={"section " + activ} onClick={(tab) => this.props.onClick(tab)}>{tabName}
                <svg width="6" height="8" viewBox="0 0 6 8" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="M0 0L6 4.03L0 8V0Z" fill="#999999"/>
                </svg>
            </span> 
        )
    }

    render() {
        if (this.props.activeTab.location) {
            console.log(this.props.activeTab.location)
            return (
                <nav>
                    {this.renderSpan("location", "Местоположение", "activ-nav")}
                    {this.renderSpan("", "Модель", "")}
                    {this.renderSpan("", "Дополнительно", "")}
                    {this.renderSpan("", "Итого", "")}
                </nav>
            );
        } else if (this.props.activeTab.model) {
            console.log(this.props.activeTab.model)
            return (
                <nav>
                    {this.renderSpan("location", "Местоположение", "passed-nav")}
                    {this.renderSpan("", "Модель", "activ-nav")}
                    {this.renderSpan("", "Дополнительно", "")}
                    {this.renderSpan("", "Итого", "")}
                </nav>
            );
        } else if (this.props.activeTab.extra) {
            console.log(this.props.activeTab.extra)
            return (
                <nav>
                    {this.renderSpan("location", "Местоположение", "passed-nav")}
                    {this.renderSpan("", "Модель", "passed-nav")}
                    {this.renderSpan("", "Дополнительно", "activ-nav")}
                    {this.renderSpan("", "Итого", "")}
                </nav>
            );
        } else if (this.props.activeTab.total){
            console.log(this.props.activeTab.total)
            return (
                <nav>
                    {this.renderSpan("location", "Местоположение", "passed-nav")}
                    {this.renderSpan("", "Модель", "passed-nav")}
                    {this.renderSpan("", "Дополнительно", "passed-nav")}
                    {this.renderSpan("", "Итого", "activ-nav")}
                </nav>
            );
        }
    }
}

export default Nav;
